    private static int[] v;

    public static void sort(int[] vv) {
        v = vv;
        sort_offset(0, vv.length-1);
    }

    private static void sort_offset(int a, int b) {
        switch(b-a+1) {
            case 12: sort_12_offset(a); break;
            case 11: sort_11_offset(a); break;
            case 10: sort_10_offset(a); break;
            case 9: sort_9_offset(a); break;
            case 8: sort_8_offset(a); break;
            case 7: sort_7_offset(a); break;
            case 6: sort_6_offset(a); break;
            case 5: sort_5_offset(a); break;
            case 4: sort_4_offset(a); break;
            case 3: sort_3_offset(a); break;
            case 2: sort_2_offset(a); break;
            case 1: break;
            case 0: break;
            default: quickSort(a,b); break;
        }
    }

    public static void quickSortOnly(int[]vv){
        v = vv;
        if (v.length <= 0) return;
        quickSortOnlyImm(0, v.length-1);
    }

    private static void quickSortOnlyImm(int lowerIndex, int higherIndex) {
        int i = lowerIndex;
        int j = higherIndex;
        //System.out.println("INDEX: "+ higherIndex + " " + lowerIndex);
        int pivot = v[(higherIndex+lowerIndex)/2];
        while (i <= j) {

            while (v[i] < pivot) {
                i++;
            }
            while (v[j] > pivot) {
                j--;
            }
            if (i <= j) {
                int temp = v[i];
                v[i] = v[j];
                v[j] = temp;
                i++;
                j--;
            }
        }
        // call quickSort() method recursively
        if (lowerIndex < j) {
            quickSortOnlyImm(lowerIndex, j);
        }
        if (i < higherIndex){
            quickSortOnlyImm(i, higherIndex);
        }
    }

    private static void quickSort(int lowerIndex, int higherIndex) {
        int i = lowerIndex;
        int j = higherIndex;
        //System.out.println("INDEX: "+ higherIndex + " " + lowerIndex);
        int pivot = v[(higherIndex+lowerIndex)/2];
        while (i <= j) {

            while (v[i] < pivot) {
                i++;
            }
            while (v[j] > pivot) {
                j--;
            }
            if (i <= j) {
                int temp = v[i];
                v[i] = v[j];
                v[j] = temp;
                i++;
                j--;
            }
        }
        // call quickSort() method recursively
        if (lowerIndex < j) {
            sort_offset(lowerIndex, j);
        }
        if (i < higherIndex){
            sort_offset(i, higherIndex);
        }
    }

